import React, { Component } from 'react'

export default class ProductList extends Component {
  render() {
    return (
      <div>
        <h1>Product List</h1>
        {/* bs5-card-background */}
        <div class="card text-white bg-primary">
          <div class="card-body">
            <h4 class="card-title">Title</h4>
            <p class="card-text">Text</p>
          </div>
        </div>
      </div>
    )
  }
}
